import React from 'react';


const ProductWrapper = (props) => {
    return (
        <div className="productdesign" style={{ width: '200px', height: '300px' }}>

            <img src={props.image} />
            <p>{props.title}</p>
            <button>View</button>
        </div>
    )
}
export default ProductWrapper;
